Set in Glasgow, Scotland, the film is about a girl called Eve who is in 
the hospital dealing with some emotional problems and starts writing 
songs as a way of getting better. Songwriting becomes her way forward, 
leading her to the City where she meets James and Cassie, two musicians 
each at crossroads of their own. What follows is a story of renaissance 
over the course of a long, dream-like Summer.


